import React from "react";
import Head from "next/head";
import AppLayout from "../components/AppLayout";

function profile() {
  return (
    <>
      <AppLayout>
        {/* 큼직큼직하게 먼저 가상의 컴포넌트를 만든다
         */}
        <NicknameEdit />
        <FollowList header="팔로잉 목록" />
        <FollowerList header="팔로워 목록" />
      </AppLayout>
    </>
  );
}

export default profile;
